    - content: "Memorandum for custodial personnel:\nDue to concerns voiced by service crewmembers, the Janitor staff are issued to the count of ONE EVA suit and helmet for the reasons of being able to vacate the atmosphere in Disposals. These articles are labeled as \"Custodial EVA suit\" and \"Custodial EVA helmet\" respectively. Non-custodial staff are advised to return these items to either the Janitors or Head of Personnel, if found.\n \n"
